    return (
        <GetAllData
            apiUrl="http://example.com/api/items"
            itemName="Item"
            onDataUpdate={handleDataUpdate}
            itemKeys={["itemId", "itemName", "otherKey"]}
        />
    );
};

export default Advertisements;
